import React from "react";

const AppPagination = ({ pageNumber }) => {
  const arr = Array.from(Array(pageNumber).keys());

  return (
    <nav aria-label="Page navigation example">
      <ul className="pagination">
          {arr?.map()}

          </ul>
    </nav>
  );
};

export default AppPagination;
